import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useAuth } from '../App';

const Navbar = () => {
  const { user, logout } = useAuth();
  const location = useLocation();

  const isActive = (path) => {
    return location.pathname === path ? 'active' : '';
  };

  const handleLogout = () => {
    logout();
  };

  const getRoleDisplay = (role) => {
    switch (role) {
      case 'admin':
        return 'Admin';
      case 'hr':
        return 'HR';
      case 'manager':
        return 'Manager';
      default:
        return role;
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white shadow-sm">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/dashboard">
          <i className="fas fa-briefcase me-2 text-primary"></i>
          ContractRec
        </Link>

        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav me-auto">
            <li className="nav-item">
              <Link className={`nav-link ${isActive('/dashboard')}`} to="/dashboard">
                <i className="fas fa-tachometer-alt me-1"></i>
                Beranda
              </Link>
            </li>

            {(user.role === 'hr' || user.role === 'admin' || user.role === 'manager') && (
              <li className="nav-item">
                <Link className={`nav-link ${isActive('/employees')}`} to="/employees">
                  <i className="fas fa-users me-1"></i>
                  Karyawan
                </Link>
              </li>
            )}

            {(user.role === 'hr' || user.role === 'admin') && (
              <li className="nav-item">
                <Link className={`nav-link ${isActive('/contracts')}`} to="/contracts">
                  <i className="fas fa-file-contract me-1"></i>
                  Kontrak
                </Link>
              </li>
            )}

            {user.role === 'admin' && (
              <li className="nav-item">
                <Link className={`nav-link ${isActive('/users')}`} to="/users">
                  <i className="fas fa-user-cog me-1"></i>
                  Users
                </Link>
              </li>
            )}
          </ul>

          <ul className="navbar-nav">
            <li className="nav-item dropdown">
              <a
                className="nav-link dropdown-toggle d-flex align-items-center"
                href="#"
                id="navbarDropdown"
                role="button"
                data-bs-toggle="dropdown"
                aria-expanded="false"
              >
                <div className="user-avatar me-2">
                  <i className="fas fa-user-circle fa-lg text-primary"></i>
                </div>
                <div className="user-info">
                  <div className="user-name">{user.username}</div>
                  <div className="user-role text-muted small">
                    {getRoleDisplay(user.role)}
                  </div>
                </div>
              </a>
              <ul className="dropdown-menu dropdown-menu-end">
                <li>
                  <h6 className="dropdown-header">
                    <i className="fas fa-user me-2"></i>
                    {user.username}
                  </h6>
                </li>
                <li>
                  <span className="dropdown-item-text">
                    <small className="text-muted">
                      <i className="fas fa-id-badge me-2"></i>
                      {getRoleDisplay(user.role)}
                    </small>
                  </span>
                </li>
                {user.division_name && (
                  <li>
                    <span className="dropdown-item-text">
                      <small className="text-muted">
                        <i className="fas fa-building me-2"></i>
                        {user.division_name}
                      </small>
                    </span>
                  </li>
                )}
                <li><hr className="dropdown-divider" /></li>
                <li>
                  <button
                    className="dropdown-item text-danger"
                    onClick={handleLogout}
                  >
                    <i className="fas fa-sign-out-alt me-2"></i>
                    Keluar
                  </button>
                </li>
              </ul>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
